import React, { Component } from 'react';
import DropdownButton from "react-bootstrap/DropdownButton";
import ButtonGroup from "react-bootstrap/ButtonGroup";
import Dropdown from "react-bootstrap/Dropdown";

class Dropdowns extends Component {
    render() {
        return (
            <ButtonGroup size="lg">
                <DropdownButton as={ButtonGroup} size="lg" variant={'Info'} title="Skin Tone">
                    <Dropdown.Item eventKey="1">Dark</Dropdown.Item>
                    <Dropdown.Item eventKey="2">Light</Dropdown.Item>
                </DropdownButton>
                <DropdownButton as={ButtonGroup} size="lg" variant={'Danger'} title="Skin Type" id="bg-nested-dropdown">
                    <Dropdown.Item eventKey="1">Oily</Dropdown.Item>
                    <Dropdown.Item eventKey="2">Moderate</Dropdown.Item>
                    <Dropdown.Item eventKey="2">Dry</Dropdown.Item>
                </DropdownButton>
                <DropdownButton as={ButtonGroup} size="lg" title="Eye Color" id="bg-nested-dropdown">
                    <Dropdown.Item eventKey="1">Black</Dropdown.Item>
                    <Dropdown.Item eventKey="2">Brown</Dropdown.Item>
                    <Dropdown.Item eventKey="1">Green</Dropdown.Item>
                    <Dropdown.Item eventKey="2">Blue</Dropdown.Item>
                    <Dropdown.Item eventKey="1">Grey</Dropdown.Item>
                    <Dropdown.Item eventKey="2">White</Dropdown.Item>
                </DropdownButton>
            </ButtonGroup>
        );
    }
}

export default Dropdowns;
